Raise your hand if you want this year to look different than last year? Me too! I want to simplify my life/classroom in as many ways as possible. #ad This is why I can’t wait to implement Prodigy because it takes all the guesswork out for me! The best part? My students love playing this fun game that adds to my math instruction -- and it's free!  The teacher dashboard allows me to monitor my students’ learning, create assessments, and differentiate math instruction for my students. I can assign specific standards to align with my teaching to support and extend my students’ learning, plus I can create my small group instruction to remediate any math skills my students are lacking with the easy-to-use reports, all at my fingertips. I can also assign a specific skill or standard to introduce, review, reinforce, or assess at each student’s level.

If you raised your hand and want to make this year different, then I encourage you to start by making things easier! Sign up for Prodigy's math game for FREE which can increase student engagement and support your math instruction at the same time.
